import classes from "./Partners.module.css";
import { Grid } from "@mui/material";
import ArrowRightAltIcon from '@mui/icons-material/ArrowRightAlt';
import theme from '../UI/Theme';

import nvidia from "../../assets/partners/Nvidia2.jpg";
import cyberport from"../../assets/partners/Cyberport.png";
import bigdata from "../../assets/partners/BigData2.png";
import cifaalh from "../../assets/partners/Cifaal.png";
import deeptech from "../../assets/partners/dt.png";
import ldeos from "../../assets/partners/Ldeos.png";
import runjie from "../../assets/partners/Runjie.png";
import menta from "../../assets/partners/Menta2.png";
import sztu from "../../assets/partners/SHTU.jpg";
import lingma from "../../assets/partners/lingma.png"
import dba from "../../assets/partners/dba.png"
import itu from "../../assets/partners/itu.png"

const logoStyle = {
  width: '30%'
};

const Partners = () => {
  return (

<div className={classes["logo-container"]}>
    <Grid item container>
      <Grid item md={3}
      sx={{
        [theme.breakpoints.down("lg")]: {
        marginLeft: "auto",
        marginRight: "auto"
        }
      }}>
      <h2>Collaboration with <br /> forward-thinking <br /> organizations</h2>
      <p className={classes.reference}>Learn More</p>
      </Grid>
      <Grid item md={9} container spacing={2}     
        sx={{
        paddingLeft: "84px",
        textAlign: "center",
        [theme.breakpoints.down("sx")]: {
        paddingLeft: "0px",
        marginLeft: "auto",
        marginRight: "auto"
        }
      }}>
        <Grid item xs={4} md={3}>
        <img src={nvidia} alt="Nvidia logo" className={classes.logo}/>
        </Grid>
        <Grid item xs={4} md={3}>
          <img src={cyberport} alt="Nvidia logo" className={classes.logo}/>
        </Grid>
        <Grid item xs={4} md={3}>
          <img src={itu} alt="Nvidia logo" className={classes.logo} style={logoStyle}/>
        </Grid>
        <Grid item xs={4} md={3}>
          <img src={runjie} alt="Nvidia logo" className={classes.logo}/>
        </Grid>
        <Grid item xs={4} md={3}>
        <img src={bigdata} alt="Nvidia logo" className={classes.logo}/>
        </Grid>
        <Grid item xs={4} md={3}>
          <img src={cifaalh} alt="Nvidia logo" className={classes.logo}/>
        </Grid>
        <Grid item xs={4} md={3}>
          <img src={deeptech} alt="Nvidia logo" className={classes.logo}/>
        </Grid>
        <Grid item xs={4} md={3}>
          <img src={ldeos} alt="Nvidia logo" className={classes.logo}/>
        </Grid>
        <Grid item xs={4} md={3}>
          <img src={menta} alt="Nvidia logo" className={classes.logo}/>
        </Grid>
        <Grid item xs={4} md={3}>
          <img src={sztu} alt="Nvidia logo" className={classes.logo}/>
        </Grid>
        <Grid item xs={4} md={3}>
          <img src={dba} alt="Nvidia logo" className={classes.logo}/>
        </Grid>

      </Grid>
    </Grid>
    </div>


  )
};

export default Partners;
